import React, { Component } from 'react';
import Item from './Item'
import AddItem from './AddItem'
import axios from "axios";
import qs from "qs";
import './Items.css'
class Items extends Component {
  state = {
    // items: [
      // { name: 'Ryu', age: 30, belt: 'black', id: 1, pic: "data:image/svg+xml;base64,"},
      // { name: 'Yoshi', age: 20, belt: 'green', id: 2,pic: "data:image/svg+xml;base64," },
      // { name: 'Crystal', age: 25, belt: 'pink', id: 3,pic: "data:image/svg+xml;base64," }
    // ]
  };
  componentDidMount() {
    let url = "http://localhost:8080/newarrival";
    axios.get(url)
        .then(res=>this.setState({
            items: res.data
        }
    ))
        // .then(res=> console.log(this.state.items))
  .catch(function (error) {
    // alert("somthing wrong")
  });
  }
  addItem = (item) => {
    var url='http://localhost:8080/admin/addProduct';
    fetch(url, {
  method: 'POST', // or 'PUT'
  body: JSON.stringify(item), // data can be `string` or {object}!
  headers:{
    'Content-Type': 'application/json'
  }
}).then(res => res.json())
.then(response => console.log('Success:', JSON.stringify(response)))
.catch(error => console.error('Error:', error));

    item.id = Math.random();
    let items = [...this.state.items, item];
    this.setState({
      items: items
    });
  }
  deleteItem = (id) => {
    // console.log(id);
    let items = this.state.items.filter(item => {
      return item.id !== id
    });
    this.setState({
      items: items
    });
  }
  render() {
    return (
      <div className="home-items">
        <h1>Most popular</h1><hr/>
        <Item items={this.state.items} deleteItem={this.deleteItem} />
        <hr/>
        <h1>New arrival</h1>
        <hr/>
        <Item items={this.state.items} deleteItem={this.deleteItem} />
        <AddItem addItem={this.addItem} />
      </div>
    );
  }
}

export default Items;
